import React from 'react'
import { Link } from 'react-router-dom'

export default function NavBar() {
  return (
    <nav className="navbar navbar-dark bg-dark">
    <div className="container d-flex justify-content-end my-2">
       <Link className="btn btn-sm btn-danger btn rounded-pill" to="/register">Register</Link>
       <Link className="btn btn-sm btn-danger btn rounded-pill mx-2" to="/register">Login</Link>
      </div>
  </nav>
    
  )
}
